import {Link} from "react-router-dom";
import './Home.css';


const Home = () => {
    return (
        <div className="article mx-auto col-xl-10 col-lg-11 col-md-11 col-sm-12">
            <div className="row p-5 bg-dark col-lg-12 col-sm-12 justify-content-center align-items-center">
               <div className="offset-xl-1 col-xl-4 col-lg-5 col-md-4 col-sm-12">
                   <h2>Univers</h2>
               </div>
               <div className="offset-xl-1 col-xl-4 col-lg-5 col-md-4 col-sm-12">
                   <h2></h2>
               </div>
            </div>
            
        </div>
    );
}

export default Home;
